Компания АБ Риэлти – это команда профессионалов, оперативно решающая любые вопросы, связанные с недвижимостью. 

Основные направления деятельности:

•	покупка и продажа квартир, загородных домов и земельных участков;
•	обмен объектов недвижимости;
•	сдача в аренду квартир и домов;
•	покупка, продажа и сдача в аренду коммерческой недвижимости;
•	консультирование по всем этапам сделки объекта;
•	юридическая проверка документов.

Мы оказываем полное сопровождение и консалтинг по купле-продаже и аренде объектов недвижимости до момента получения денег или документов о собственности и успешного закрытия сделки. 
Обеспечиваем конфиденциальность информации.

Наша цель - долгосрочные отношения с клиентом!

Главный офис компании находится на ул. Островитянова, д. 6.

